import React from 'react';
import './Guideslist.css';
import Navbar from './navbar';

const images = [
  { src: require('../images/apexlegends.png'), },
  { src: require('../images/callofdutywarzone.png'), title: 'Call of Duty Warzone 2.0' },
  { src: require('../images/counterstrike2.png'), title: 'Counter Strike 2' },
  { src: require('../images/fortnite.png'), title: 'Fortnite' },
  { src: require('../images/leagueoflegends.png'), title: 'League of Legends' },
  { src: require('../images/overwatch2.png'), title: 'Overwatch 2' },
  { src: require('../images/rainbowsixsiege.png'), title: 'Rainbow Six Siege' },
  { src: require('../images/rocketleague.png'), title: 'Rocket League' },
  { src: require('../images/valorant.png'), title: 'Valorant' },
];

const Guideslist = () => {
  return (
    <div>
      <Navbar />
      <div className="guides-list">
        {images.map((image, index) => (
          <div key={index} className="guide-item">
            <div className="overlay-container">
              <img src={image.src} alt={image.title} />
              <div className="overlay">
                <h3>{image.title}</h3>
              </div>
            </div>
            <p>{image.title}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Guideslist;
